package com.transport.model;

public class CabDetails {

	
	private int cabId;
	private int cabNo;
	public CabDetails(int cabId, int cabNo) {
		super();
		this.cabId = cabId;
		this.cabNo = cabNo;
	}
	public CabDetails() {
		// TODO Auto-generated constructor stub
	}
	public int getCabId() {
		return cabId;
	}
	public void setCabId(int cabId) {
		this.cabId = cabId;
	}
	public int getCabNo() {
		return cabNo;
	}
	public void setCabNo(int cabNo) {
		this.cabNo = cabNo;
	}
	
	
	
	
	
	
	
	
	
	
	
}
